The Company's oversight and governance is quite weak. The following instances were observed to support the conclusion:

1) The Company does not have a formal or informal advisory board;

2) The MD who is also the main shareholder extended a shareholder loan to the Company in the absence of a formal contract or/and policy in place;

3) The MD holds a part-time external role as Project Manager in a personal capacity with the former employer. The MD has directed efforts towards the business instead of the consultancy contracts. This has had the resultant effect of lower profitability of the Company.

However, it was noted that the Company was in the process of engaging an external contractor to implement the relevant policies and procedures. These are expected to include finance, HR, and procurement policies. The part-time role seemed to separate the role of attracting business to the Company as a subcontractor. The Company finalized on the draft policies and are now approved as per recommendations by the external auditor and monitoring efforts by Charm Portfolio Officer.
